import WelcomePage from "./pages/WelcomePage";
import SignupPage from "./pages/SignupPage";
import SigninPage from "./pages/SigninPage";
import HomePage from "./pages/HomePage";
import NavBar from "./components/NavBar";

function App() {
  return (
    <div className="App">
      <NavBar />
      <Switch>
        <Route path="/">
          <WelcomePage />
        </Route>
        {/* <Route path="/signup" exacte component={SignupPage} /> */}
        {/* <Route path="/signin" exacte component={SigninPage} /> */}
        {/* <Route path="/home" exacte component={HomePage} /> */}
      </Switch>
    </div>
  );
}

export default App;
